{
  "translationLines": [
    {
      "lineNumber": 225762,
      "originalJapaneseLine": "「ありがとう……」",
      "translatedEnglishLine": "\"Thank you...\""
    },
    {
      "lineNumber": 225763,
      "originalJapaneseLine": "スシヌが顔を上げて扉を睨みつける。",
      "translatedEnglishLine": "Sushinu looked up and glared at the door."
    },
    {
      "lineNumber": 225764,
      "originalJapaneseLine": "その表情には覚悟が込められていた。",
      "translatedEnglishLine": "Determination was clearly written across her expression."
    },
    {
      "lineNumber": 225765,
      "originalJapaneseLine": "「い、行きます……」",
      "translatedEnglishLine": "\"I-I'm going...\""
    },
    {
      "lineNumber": 225766,
      "originalJapaneseLine": "「あっ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 225767,
      "originalJapaneseLine": "扉を開けるとまず大量の人が視界に飛び込んできた。",
      "translatedEnglishLine": "When the door opened, a large crowd immediately burst into view."
    },
    {
      "lineNumber": 225768,
      "originalJapaneseLine": "昼下がりの首都の表通りは、",
      "translatedEnglishLine": "The main street of the capital on an early afternoon,"
    },
    {
      "lineNumber": 225769,
      "originalJapaneseLine": "たくさんの人で賑やかだった。",
      "translatedEnglishLine": "was bustling with many people."
    },
    {
      "lineNumber": 225770,
      "originalJapaneseLine": "「あ、ねえねえ、あそこ見て……」",
      "translatedEnglishLine": "\"Ah, hey hey, look over there...\""
    },
    {
      "lineNumber": 225771,
      "originalJapaneseLine": "「おお、スシヌ様だ、久し振りに見た……」",
      "translatedEnglishLine": "\"Oh, it's Lady Sushinu, I haven't seen her in a long time...\""
    },
    {
      "lineNumber": 225772,
      "originalJapaneseLine": "「周りにいらっしゃるのは、",
      "translatedEnglishLine": "\"Those around her,"
    },
    {
      "lineNumber": 225773,
      "originalJapaneseLine": "　もしかしてご兄弟の？」",
      "translatedEnglishLine": "could they possibly be her siblings?\""
    },
    {
      "lineNumber": 225774,
      "originalJapaneseLine": "「ああ、間違いなさそうだ。",
      "translatedEnglishLine": "\"Yeah, that seems about right."
    },
    {
      "lineNumber": 225775,
      "originalJapaneseLine": "　みんな立派になったなぁ」",
      "translatedEnglishLine": "They have all become quite distinguished.\""
    },
    {
      "lineNumber": 225776,
      "originalJapaneseLine": "「あ、あ、あ……」",
      "translatedEnglishLine": "\"Ah, ah, ah...\""
    },
    {
      "lineNumber": 225777,
      "originalJapaneseLine": "スシヌの首から頭の先までが、",
      "translatedEnglishLine": "From her neck to the top of her head,"
    },
    {
      "lineNumber": 225778,
      "originalJapaneseLine": "順番にカーッと赤くなっていく。",
      "translatedEnglishLine": "Sushinu blushed deeply, flushing bright red in order."
    },
    {
      "lineNumber": 225779,
      "originalJapaneseLine": "「……めっさ注目されとる。",
      "translatedEnglishLine": "\"...I'm getting so much attention."
    },
    {
      "lineNumber": 225780,
      "originalJapaneseLine": "　あれ？　いつもこんなもんだっけ？」",
      "translatedEnglishLine": "Huh? Is it always like this?\""
    },
    {
      "lineNumber": 225781,
      "originalJapaneseLine": "「田舎ならいざ知らず都市ならこんなもんだ。",
      "translatedEnglishLine": "\"Well, in the countryside maybe not, but in the city, this is normal."
    },
    {
      "lineNumber": 225782,
      "originalJapaneseLine": "　王族ご一行がうろうろしてりゃ、",
      "translatedEnglishLine": "When a royal party is wandering about,"
    },
    {
      "lineNumber": 225783,
      "originalJapaneseLine": "　人の視線が集中して当然だがな」",
      "translatedEnglishLine": "it’s only natural that everyone's attention would focus on them.\""
    },
    {
      "lineNumber": 225784,
      "originalJapaneseLine": "「がははは、愚民が恐れおののき注目してんだ！",
      "translatedEnglishLine": "\"Gahaha, the common folk are trembling in fear and watching!\""
    },
    {
      "lineNumber": 225785,
      "originalJapaneseLine": "　中々悪くねー気分だがな！」",
      "translatedEnglishLine": "\"It actually feels pretty good!\""
    },
    {
      "lineNumber": 225786,
      "originalJapaneseLine": "「…………って、アン？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 225787,
      "originalJapaneseLine": "「……スシヌのポンコツはどこ行った？」",
      "translatedEnglishLine": "\"...Where did the useless Sushinu go?\""
    },
    {
      "lineNumber": 225788,
      "originalJapaneseLine": "「あれ？　今までここに……」",
      "translatedEnglishLine": "\"Huh? Until now she was right here...\""
    },
    {
      "lineNumber": 225789,
      "originalJapaneseLine": "「……あ」",
      "translatedEnglishLine": "\"...Ah.\""
    },
    {
      "lineNumber": 225790,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225791,
      "originalJapaneseLine": "「テメェこら、スシヌーー！」",
      "translatedEnglishLine": "\"Hey you, Sushinu!!\""
    },
    {
      "lineNumber": 225792,
      "originalJapaneseLine": "「きゃあーー！」",
      "translatedEnglishLine": "\"Kyaa!!\""
    },
    {
      "lineNumber": 225793,
      "originalJapaneseLine": "「うううう、やっぱり私には無理ーーー！」",
      "translatedEnglishLine": "\"Uuuu, as I thought, I just can't do this!!\""
    },
    {
      "lineNumber": 225794,
      "originalJapaneseLine": "「てめえ！　今更なに抜かしてんだ！",
      "translatedEnglishLine": "\"Hey you! What the hell are you spouting now!?"
    },
    {
      "lineNumber": 225795,
      "originalJapaneseLine": "　こっち来い！　しばいてやる！」",
      "translatedEnglishLine": "Come here! I’m gonna give you a good beating!\""
    },
    {
      "lineNumber": 225796,
      "originalJapaneseLine": "「いーーーやーーー！」",
      "translatedEnglishLine": "\"N-nooo!!\""
    },
    {
      "lineNumber": 225797,
      "originalJapaneseLine": "「いい加減にしないか、ザンス！」",
      "translatedEnglishLine": "\"Won’t you cut it out already, Zansu!\""
    },
    {
      "lineNumber": 225798,
      "originalJapaneseLine": "「アア！？　なんでテメェが出てくんだ！？」",
      "translatedEnglishLine": "\"Huh!? Why the hell are you the one stepping in!?\""
    },
    {
      "lineNumber": 225799,
      "originalJapaneseLine": "「お前が馬鹿なことばかりするからだ」",
      "translatedEnglishLine": "\"Because you keep doing stupid things.\""
    },
    {
      "lineNumber": 225800,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 225801,
      "originalJapaneseLine": "「スシヌがザンスに苛められて、",
      "translatedEnglishLine": "\"Sushinu gets bullied by Zansu,"
    },
    {
      "lineNumber": 225802,
      "originalJapaneseLine": "　それを乱義が止めて喧嘩になって……」",
      "translatedEnglishLine": "Ran'gi tries to stop it and it turns into a fight...\""
    },
    {
      "lineNumber": 225803,
      "originalJapaneseLine": "「見慣れた風景だわ……」",
      "translatedEnglishLine": "\"It's a familiar scene...\""
    },
    {
      "lineNumber": 225804,
      "originalJapaneseLine": "「今はそこに＜エール＞も",
      "translatedEnglishLine": "\"Now, even Eru"
    },
    {
      "lineNumber": 225805,
      "originalJapaneseLine": "　混じるようになったけどね。",
      "translatedEnglishLine": "has started joining in there."
    },
    {
      "lineNumber": 225806,
      "originalJapaneseLine": "　新しく見慣れるようになる光景だねぇ」",
      "translatedEnglishLine": "It's a new kind of scene we’re getting used to.\""
    },
    {
      "lineNumber": 225807,
      "originalJapaneseLine": "「おーい、みんなー！",
      "translatedEnglishLine": "\"Hey everyone!"
    },
    {
      "lineNumber": 225808,
      "originalJapaneseLine": "　お待たせー！」",
      "translatedEnglishLine": "Sorry to keep you waiting!\""
    },
    {
      "lineNumber": 225809,
      "originalJapaneseLine": "「物資の補給が終わっただすよー。",
      "translatedEnglishLine": "\"The resupply of goods is done."
    },
    {
      "lineNumber": 225810,
      "originalJapaneseLine": "　これでいつでも出発できるだー」",
      "translatedEnglishLine": "We can leave anytime now.\""
    },
    {
      "lineNumber": 225811,
      "originalJapaneseLine": "「んっ、じゃそろそろ行こうか」",
      "translatedEnglishLine": "\"Alright, then let’s get going soon.\""
    },
    {
      "lineNumber": 225812,
      "originalJapaneseLine": "「あ、ねーねー、スシヌちゃん」",
      "translatedEnglishLine": "\"Ah, hey hey, Sushinu-chan.\""
    },
    {
      "lineNumber": 225813,
      "originalJapaneseLine": "「あ、お、お姉ちゃん！」",
      "translatedEnglishLine": "\"Ah, o-older sister!\""
    },
    {
      "lineNumber": 225814,
      "originalJapaneseLine": "「昔よく二人で行ったアイス屋さん。",
      "translatedEnglishLine": "\"That ice cream shop we used to go to together a lot."
    },
    {
      "lineNumber": 225815,
      "originalJapaneseLine": "　まだ残ってるかな？」",
      "translatedEnglishLine": "I wonder if it’s still there?\""
    },
    {
      "lineNumber": 225816,
      "originalJapaneseLine": "「え、あ、どうだろ……",
      "translatedEnglishLine": "\"Umm, I’m not sure...\""
    },
    {
      "lineNumber": 225817,
      "originalJapaneseLine": "　あったと思うけど……」",
      "translatedEnglishLine": "I think it’s still there though...\""
    },
    {
      "lineNumber": 225818,
      "originalJapaneseLine": "「良かったー。",
      "translatedEnglishLine": "\"Good."
    },
    {
      "lineNumber": 225819,
      "originalJapaneseLine": "　出発する前に行きたかったの」",
      "translatedEnglishLine": "I wanted to go before we left.\""
    },
    {
      "lineNumber": 225820,
      "originalJapaneseLine": "「お姉ちゃん、お店の場所を忘れちゃって。",
      "translatedEnglishLine": "\"Sis, I forgot where the shop is."
    },
    {
      "lineNumber": 225821,
      "originalJapaneseLine": "　助けて欲しいんだけど頼っても、いーい？」",
      "translatedEnglishLine": "Can I rely on you for help?\""
    }
  ]
}

